Flight 370: The Missing Links

Travel Documentary hosted by Sean Pertwee, published by Discovery Channel in 2014 - English narration


Information
------------------------------

Flight 370: The Missing Links
Documentary in which some of the foremost thinkers in aviation and security explore key questions surrounding the disappearance of Malaysia Airlines flight MH370, which has garnered worldwide attention and generated widespread speculation about how the events unfolded. Discussing how it is possible to lose track of an airliner, industry experts analyse the evidence, and offer potential solutions to prevent it from happening again

